DROP TABLE IF EXISTS spotify_songs;
CREATE TABLE IF NOT EXISTS spotify_songs(
   `track_id`                 VARCHAR(22) NOT NULL PRIMARY KEY
  ,`track_name`               VARCHAR(144) NOT NULL
  ,`track_artist`             VARCHAR(69) NOT NULL
  ,`track_popularity`         INTEGER
  ,`track_album_id`           VARCHAR(22) NOT NULL
  ,`track_album_name`         VARCHAR(151) NOT NULL
  ,`track_album_release_date` VARCHAR(10) NOT NULL
  ,`playlist_name`            VARCHAR(122) NOT NULL
  ,`playlist_id`              VARCHAR(22) NOT NULL
  ,`playlist_genre`           VARCHAR(5) NOT NULL
  ,`playlist_subgenre`        VARCHAR(25) NOT NULL
  ,`danceability`             NUMERIC(6,4) NOT NULL
  ,`energy`                   NUMERIC(7,5) NOT NULL
  ,`key`                      INTEGER
  ,`loudness`                 NUMERIC(7,3) NOT NULL
  ,`mode`                     BIT  NOT NULL
  ,`speechiness`              VARCHAR(20) NOT NULL
  ,`acousticness`             VARCHAR(22) NOT NULL
  ,`instrumentalness`         VARCHAR(22) NOT NULL
  ,`liveness`                 VARCHAR(20) NOT NULL
  ,`valence`                  NUMERIC(8,4) NOT NULL
  ,`tempo`                    NUMERIC(7,3) NOT NULL
  ,`duration_ms`              INTEGER  NOT NULL,

   INDEX idx_artist (track_artist),
   INDEX idx_album (track_album_id),
   INDEX idx_genre (playlist_genre),
   INDEX idx_subgenre (playlist_subgenre),
   INDEX idx_popularity (track_popularity),
   INDEX idx_release_date (track_album_release_date)
);

